    public static GetAlarmListResponse getAlarmListResponse() {
        GetAlarmListResponse response = JsonUtil.Json2Bean(TEST_DATA, GetAlarmListResponse.class);
        CoordinateConverter coordinateConverter;
        LatLng latLng;
        for (GetAlarmListResponse.DataBean.ListBean listBean : response.getData().getList()) {
            // 经度
            double longitude = ArithmeticUtil.stringToDouble(listBean.getPx(), 6);
            // 纬度
            double latitude = ArithmeticUtil.stringToDouble(listBean.getPy(), 6);

            // GPS坐标转换为百度坐标
            coordinateConverter = new CoordinateConverter();
            latLng = coordinateConverter.from(CoordinateConverter.CoordType.GPS)
                    .coord(new LatLng(latitude, longitude))
                    .convert();
            listBean.setBaiDuLatLng(latLng);
        }
        return response;
    }

    public static void viewTrack() {
        CoordinateConverter coordinateConverter = new CoordinateConverter();
        LatLng latLng = coordinateConverter.from(CoordinateConverter.CoordType.GPS)
                .coord(new LatLng(22.580594, 114.100365))
                .convert();
        Log.e("viewTrack", "viewTrack 111: latlng = " + new LatLng(latLng.latitude, latLng.longitude) + "   ==   "
                + new LatLng(ArithmeticUtil.doubleBigDecimal(latLng.latitude, 6)
                , ArithmeticUtil.doubleBigDecimal(latLng.longitude, 6)).toString());


        double[] jwd = CoordinateTransformUtil.wgs84tobd09(114.100365, 22.580594);
        Log.e("viewTrack", "viewTrack 222: latlng = " + new LatLng(jwd[1], jwd[0]) + "   ==   "
                + new LatLng(ArithmeticUtil.doubleBigDecimal(jwd[1], 6)
                , ArithmeticUtil.doubleBigDecimal(jwd[0], 6)));
    }
